        <div>
            <div>
              <h3> Gr√°fico de estado consultas</h3>
              <div className='pie-chart'>
                <PieChart
                  data={[
                    { title: 'Consultas Exitosas', value: data.success.true, color: '#008000' },
                    { title: 'Consultas Fallidas', value: 0, color: '#C13C37' }
